import { HeaderOne } from "../Header";
import { FooterTwo } from "../Footer";

const LayoutTwo = ({ children, aboutOverlay, onSubmitSearchAllHandle, onSearchAllChange }) => {
  return (
    <div>
      <HeaderOne 
      aboutOverlay={aboutOverlay} 
      onSubmitSearchAllHandle={onSubmitSearchAllHandle}
      onSearchAllChange={onSearchAllChange}
      />
      {children}
      <FooterTwo />
    </div>
  );
};

export default LayoutTwo;
